import React from 'react';
import { Grid, Image } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {
    return (
        <React.Fragment>
            <List bulleted horizontal>
                <List.Item as='a'> <Image onClick={() => alert(props.movieDetails)} src={props.movieImage} className="sizeOfContainerMovieImage" />s</List.Item>
            </List>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
